### Example 2: A user-generated dataset {#Sec10}

The dataset is a collection of user-generated data that was collected from a number of different sources. The dataset is available at <https://github.com/james-d-s-lab/dengue-fever-dataset>.

### Data preprocessing {#Sec11}

All data was preprocessed using the R package *pander* \[[@CR23]\]. The dataset was split into training and test sets using the *train* function in *pander*. The training set was used to train the model and the test set was used for evaluation.

### Model training {#Sec12}

A random forest model was trained using the *randomForest* function in the *pander package*. The model was trained on the training set and then evaluated on the test set. The model was built using the *forest* function in R. The model used a random forest algorithm with a maximum depth of 10 trees and a minimum number of features of 5. The model's performance was evaluated using the *accuracy* function in pander.

