Haloperidols are the first-generation antipsychotics (SGA) and are the most commonly used antipsychotics in the United States. They are characterized by a high affinity for dopamine D~2~ receptors and a low affinity for serotonin 5-HT~2A~ receptors. They are also characterized by a low affinity to muscarinic receptors. Haloperidols have a high affinity to the dopamine D~3~ receptor and a low to moderate affinity to the serotonin 5-H~1~ receptor. They are metabolized by the cytochrome P450 (CYP) 3A4 enzyme. Haloperids are metabolized primarily by the CYP3A4 enzyme, and the metabolites are primarily excreted in the urine. Haloperidine is the most commonly prescribed haloperidole.

